import React, { Component } from 'react'
import Header from '../homepage/header/Header';

export default class Game extends Component {
    constructor(props){
        super(props);
        this.state={
            game:this.props.game
        };
    }
    render() {
        return (
            <div>
                <Header></Header>
            </div>
        )
    }
}
